# --- Title & Description ---
st.title("Your Legal Copilot, Reinvented")
st.markdown(
    "Upload a contract or agreement, and Clausemate will break it down for you in plain English."
)

# --- File Uploader ---
st.markdown("📎 Upload a legal document (.pdf or .txt)")
uploaded_file = st.file_uploader(" ", type=["pdf", "txt"])

def extract_text_from_pdf(file):
    text = ""
    with fitz.open(stream=file.read(), filetype="pdf") as doc:
        for page in doc:
            text += page.get_text()
    return text

text = ""
if uploaded_file:
    st.success("✅ File uploaded successfully")
    st.info(f"📄 Detected file type: {uploaded_file.name}")

    try:
        if uploaded_file.name.endswith(".pdf"):
            st.info("📘 Extracting PDF text...")
            text = extract_text_from_pdf(uploaded_file)
        elif uploaded_file.name.endswith(".txt"):
            st.info("📄 Extracting TXT text...")
            text = uploaded_file.read().decode("utf-8")
        else:
            st.warning("⚠️ Unsupported file type.")
    except Exception as e:
        st.error(f"❌ Error reading file: {e}")

    if text.strip() == "":
        st.warning("⚠️ No text extracted from the file.")

    # Skip displaying the raw extracted text
    # st.text_area("Extracted Text", text, height=200)

    if st.button("Summarize Document"):
        with st.spinner("Summarizing..."):
            try:
                response = client.chat.completions.create(
                    model="gpt-3.5-turbo",
                    messages=[
                        {"role": "system", "content": "You are a helpful legal assistant."},
                        {"role": "user", "content": f"Summarize this legal document:\n{text}"}
                    ]
                )
                summary = response.choices[0].message.content
                st.success("📝 Summary:")
                st.write(summary)
            except Exception as e:
                st.error(f"❌ Error: {e}")

    st.markdown("---")
    st.subheader("Ask a Question")

    question = st.text_input("Enter your question:")

    if question and st.button("Ask"):
        with st.spinner("Thinking..."):
            try:
                response = client.chat.completions.create(
                    model="gpt-3.5-turbo",
                    messages=[
                        {"role": "system", "content": "You are a helpful legal assistant."},
                        {"role": "user", "content": f"Based on the following legal text:\n{text}\n\nAnswer the question: {question}"}
                    ]
                )
                answer = response.choices[0].message.content
                st.success("🧠 Answer:")
                st.write(answer)
            except Exception as e:
                st.error(f"❌ Error: {e}")


# --- Footer ---
st.markdown("---")
st.caption("🧪 Experimental legal AI project · Created by Terry Dilbert")
